<script type="text/javascript">
  
                                          
                                                
function validateBasket(product_id, default_stock) {

    var tmpValue;
    var choosen_stock = 0;
    $('.basket-product-button-'+product_id+' .dd-container .dd-selected-value').each(function () {
          tmpValue = $(this).val();
          if (tmpValue > 0) {
              choosen_stock = tmpValue;
          }
          
        });

    
    if (choosen_stock > 0 && (
        (choosen_stock == 2 && choosen_stock == default_stock)
        || (choosen_stock != 2  && (default_stock == 1 || default_stock == 4))
            )) {
        addToCartBasket(product_id, choosen_stock, 1);
    } 
    else if (choosen_stock < 1) {
        $.dialog({
                title: '',
                content:  "Proszę wybrać magazyn",
                type: 'red',
                theme: 'material',
                typeAnimated: true,

            });
